    @Test
    void testBlock249062() throws CborException {
        List<byte[]> witnessField = WitnessUtil.getWitnessRawData(
                HexUtil.decodeHexString(rawCborBlock249063));
        List<byte[]> datumOfWitness = (List<byte[]>) witnessField.stream()
                .map(witness -> {
                    try {
                        return getArrayBytes(WitnessUtil.getWitnessFields(witness).get(BigInteger.valueOf(4L)));
                    } catch (CborException e) {
                        e.printStackTrace();
                    }
                    return Collections.emptyList();
                })
                .filter(list -> list != null && !list.isEmpty())
                .flatMap(List::stream)
                .toList();

        List<String> hashes = datumOfWitness.stream()
                .map(bytes -> HexUtil.encodeHexString(Blake2bUtil.blake2bHash256(bytes)))
                .toList();

        List<String> list = List.of("25828c5a756ccd2f2cac104308be8a4393888642809ea6e6ca0ba0cab8901a63",
                "ff5f5c41a5884f08c6e2055d2c44d4b2548b5fc30b47efaa7d337219190886c5",
                "74beffde153d1660b5c90345d71eac2d1bb1cc227a78f9d3bb521dd5b5405967",
                "e435451f4a54d775e3e2e9742d506c32c45f7c6a3028a0587e35e2028cdd241a",
                "17276a2f4d44aa38638c73d373a21d8beff1c7351d1991b6d77c46e45baa9e72");

        Assertions.assertTrue(hashes != null && !hashes.isEmpty());
        for (int i = 0; i < hashes.size(); i++) {
            Assertions.assertEquals(hashes.get(i), list.get(i));
        }
    }

    @Test
    void testDatum178062() throws CborException {
        List<byte[]> witnessField = WitnessUtil.getWitnessRawData(
                HexUtil.decodeHexString(rawCborBlock178062));
        List<byte[]> datumOfWitness = (List<byte[]>) witnessField.stream()
                .map(witness -> {
                    try {
                        var witnessFields = WitnessUtil.getWitnessFields(witness).get(BigInteger.valueOf(4L));
                        if (Objects.isNull(witnessFields)) {
                            return Collections.emptyList();
                        }

                        return getArrayBytes(witnessFields);
                    } catch (CborException e) {
                        e.printStackTrace();
                    }
                    return Collections.emptyList();
                })
                .filter(list -> list != null && !list.isEmpty())
                .flatMap(List::stream)
                .toList();

        List<String> hashes = datumOfWitness.stream()
                .map(bytes -> HexUtil.encodeHexString(Blake2bUtil.blake2bHash256(bytes)))
                .toList();

        List<String> list = List.of("8828013bf8f54bec83b14f96ced5b9061f231c51fc981bd9931a4cf7edc39537");
        Assertions.assertTrue(!hashes.isEmpty());
        for (int i = 0; i < hashes.size(); i++) {
            Assertions.assertEquals(hashes.get(i), list.get(i));
        }
    }

